import React from "react";

const Home = () => {
  const products = [
    { title: 'Cabbage', isFruit: false, id: 1 },
    { title: 'Garlic', isFruit: false, id: 2 },
    { title: 'Apple', isFruit: true, id: 3 },
  ];

  const fruitProducts = products.filter(product => product.isFruit);

  const listitem = fruitProducts.map(product => (
    <li
      key={product.id}
      style={{ color: product.isFruit ? 'red' : 'green' }}
    >
      {product.title}
    </li>
  ));

  return (
    <div>
      <ul>{listitem}</ul>
    </div>
  );
};

export default Home;
